script: |
  super -f text -I q5915.spq | sort > q5915.out

inputs:
  - name: q5915.spq
    data: |
      SELECT DISTINCT - cor0.col1 + - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN ( col0 * col2 ) AND + col0 + - col0 * col2 / + col0;
  - name: tab0

outputs:
  - name: q5915.out
    data: |
